create table world_maps_positions
(
    Id                    int     not null
        primary key,
    PosX                  int     not null,
    PosY                  int     not null,
    Outdoor               tinyint not null,
    SubAreaId             int     not null,
    Capabilities          int     not null,
    WorldMap              int     not null,
    NameId                int     not null,
    HasPriorityOnWorldmap tinyint not null
)
    engine = MyISAM
    charset = utf8;

